window.bookSummaryJSON = "<p><b>INTERNATIONAL BESTSELLER • In the electrifying first installment of the </b><b><i>New York Times</i></b><b> bestselling series, Harry Hole of the Oslo Crime Squad is dispatched to Sydney to observe a murder case. As he circles closer to the killer, Harry begins to fear that no one is safe, least of all those investigating the murder.<br> </b><br> The victim is a twenty-three year old Norwegian woman who is a minor celebrity back home. Harry is free to offer assistance, but he has firm instructions to stay out of trouble. Never one to sit on the sidelines, Harry befriends one of the lead detectives, and one of the witnesses, as he is drawn deeper into the case. Together, they discover that this is only the latest in a string of unsolved murders, and the pattern points toward a psychopath working his way across the country.<br> <br> <b>Don't miss Jo Nesbo's latest Harry Hole thriller, </b><b><i>Killing Moon</i></b><b>!</b></p>"; 
